const imageData = [
    {
      label: "Image1",
      alt: "image1",
      src: "./images/Artwork_Vinayaka.jpg"
    },
    {
      label: "Image 2",
      alt: "image2",
      src: "./images/Artwork_Snow1.jpg"
    },
    {
      label: "Image 3",
      alt: "image3",
      src: "./images/Artwork_old_car.jpg"

    },
    {
      label: "Image 4",
      alt: "image4",
      src: "./images/Artwork_boat.jpg"
    },
    {
        label: "Image 5",
        alt: "image5",
        src: "./images/Artwork_forest.jpg"
    },
    {
        label: "Image 6",
        alt: "image6",
        src: "./images/Artwork_good_morning.jpg"
    },
    {
        label: "Image 7",
        alt: "image7",
        src: "./images/Artwork_mushroom_world.jpg"
    },
    {
        label: "Image 8",
        alt: "image8",
        src: "./images/building1.jpg"
    }
  ];


export const renderSlides = imageData.map((image) => (
    <div key={image.alt}>
      <img src={image.src} alt={image.alt} />
      <p className="carousel-caption">{image.label}</p>
    </div>
));
